// Combine all paths into one object (currently the same as otherPaths)
export const icons = {
  ...otherPaths,
};

export type IconName = keyof typeof icons;

interface TechIconProps extends React.SVGProps<SVGSVGElement> {
  name: IconName;
}

export function TechIcon({ name, className, ...props }: TechIconProps) {
  const iconData = icons[name];

  if (!iconData) {
    console.warn(`Icon "${name}" not found`);
    return null;
  }

    const cn = (...classes: (string | undefined | null)[]) => 
        classes.filter(Boolean).join(" ");

  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox={iconData.viewBox}
      className={cn("fill-current", className)}
      {...props}
    >
      {iconData.path}
    </svg>
  );
}